import React from 'react';
import { Link } from 'react-router-dom';

const Lecture = () => {
    return (
        <div>
            <h2>Lecture</h2>
            <table>
                <tr>
                    <th><Link to="/Lecture/Introductions">Introduction</Link></th>
                </tr>
            </table>
        </div>
    );
};

export default Lecture;
